import React from 'react';
import styles from '../styles/InicioDashboard.module.css';

const Body = () => {
    return (
    <body>
  <section className={styles.seccion_informacion_inicial}>
    <div className={styles.informacion_inicial}>
      <h1>FinanceSync®</h1>
      <p>Gestionar tus finanzas nunca ha sido tan fácil. FinanceSync es una aplicación diseñada para ayudarte a llevar un control completo de tus gastos, ingresos y ahorros de manera intuitiva y eficiente. Con su interfaz amigable y herramientas avanzadas.</p>
      <div className={styles.boton_inicio}>
        <button className={styles.boton_explorar}>¡Explorar!</button>
      </div>
    </div>
    <img src="ImgDashboard/IMG Principal 1.png" alt="" width="546px" height="294px"/>
  </section>
   </body>
  );
};

export default Body;
